import React from "react";

export default function BarraSecundaria(){
    return(
        <div className="navbar-secundario">
            <div className="navbar-button">
                <button className="button-navbar">Perfil</button>
            </div>
            <div className="navbar-button">
                <button className="button-navbar">Compra/Venta</button>
            </div>
        </div>
    )
}
